import React, { useState } from "react";
import IITILOGO from "./images/iitilogo.png";

export default function Left() {
  const [style, setStyle] = useState({
    textDecoration: "none",
    color: "black",
    marginTop: "8vh",
  });
  const [style4, setStyle4] = useState({
    textDecoration: "none",
    color: "black",
    fontSize: "2.2vh",
   marginTop:"2.5vh"
  });
  const [style1, setStyle1] = useState({
    textDecoration: "none",
    color: "black",
       marginTop:"4vh",
  });
  const [style2, setStyle2] = useState({
    textDecoration: "none",
    color: "black",
       marginTop:"4vh",
  });
  const [style3, setStyle3] = useState({
    textDecoration: "none",
    color: "black",
       marginTop:"4vh",
  });

  return (
    <>
      <div className="left d-flex" style={{ borderCollapse: "collapse",position :"fixed" }}>
        <div
          className="firstleft d-flex"
          style={{
            flexDirection: "column",
            height: "100vh",
            width: "4.5vh",
            backgroundColor: "rgb(59 99 139)",
            fontSize: "1.5rem",
            paddingLeft: "0.2rem",
            paddingTop: "0.4rem",
          }}
        >
          <a
            href="#"
            style={style4}
            onMouseEnter={() => {
            setStyle4({
               color: "white",
               backgroundColor: "rgb(141 144 147 / 36%)",
               textDecoration: "none",
              fontSize: "2.2vh",
               marginTop:"2.5vh",
              });
            }}
            onMouseLeave={() => {
              setStyle4({
                color: "black",
                 marginTop:"2.5vh",
                textDecoration: "none",
                fontSize: "2.2vh",
              });
            }}
          >
            <i className="fa-solid fa-angles-left"></i>
          </a>

          <a
            href="#"
            className="mx-8"
            style={style}
            onMouseEnter={() => {
              setStyle({
                color: "white",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
                marginTop:"8vh",
              });
            }}
            onMouseLeave={() => {
              setStyle({
                color: "black",
                textDecoration: "none",
                marginTop:"8vh",
              });
            }}
          >
            <i className="fa-solid fa-qrcode"></i>
          </a>
          <a
            href="#"
            style={style1}
            onMouseEnter={() => {
              setStyle1({
                color: "white",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
                marginTop:"4vh",
              });
            }}
            onMouseLeave={() => {
              setStyle1({
                color: "black",
marginTop:"4vh",
                textDecoration: "none",
              });
            }}
          >
            <i className="fa-regular fa-user"></i>
          </a>
          <a
            href="#"
            style={style2}
            onMouseEnter={() => {
              setStyle2({
                color: "white",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
                marginTop:"4vh",
              });
            }}
            onMouseLeave={() => {
              setStyle2({
                color: "black",
marginTop:"4vh",
                textDecoration: "none",
              });
            }}
          >
            <i className="fa-regular fa-user"></i>
          </a>
          <a
            href="#"
            style={style3}
            onMouseEnter={() => {
              setStyle3({
                color: "white",
                textDecoration: "none",
                marginTop:"4vh",
                backgroundColor: "rgb(141 144 147 / 36%)",
              });
            }}
            onMouseLeave={() => {
              setStyle3({
                color: "black",
marginTop:"4vh",
                textDecoration: "none",
              });
            }}
          >
            <i className="fa-solid fa-table-cells"></i>
          </a>
        </div>
        <div
          className="secondleft d-flex"
          style={{
            flexDirection: "column",
            height: "100vh",
            width: "16vh",
            backgroundColor: "rgb(59 99 139)",
            position: "relative",
            fontSize: "1.5rem",
            paddingTop: "0.4rem",
          }}
        >
          <a
            href="#"
            style={style4}
            onMouseEnter={() => {
              setStyle4({
                color: "white",
                marginTop:"2.5vh",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
                fontSize: "2.2vh",
              });
            }}
            onMouseLeave={() => {
              setStyle4({
                color: "black",
marginTop:"2.5vh",
                textDecoration: "none",
                fontSize: "2.2vh",
              });
            }}
          >
            Hide
          </a>
          <a
            href="#"
            style={style}
            onMouseEnter={() => {
              setStyle({
                color: "white",
            marginTop: "8vh",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
              });
            }}
            onMouseLeave={() => {
              setStyle({
                color: "black",
                 marginTop: "8vh",
                textDecoration: "none",
              });
            }}
          >
            Dashboard
          </a>
          <a
            href="#"
            style={style1}
            onMouseEnter={() => {
              setStyle1({
                color: "white",
                marginTop:"4vh",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
              });
            }}
            onMouseLeave={() => {
              setStyle1({
                color: "black",
marginTop:"4vh",
                textDecoration: "none",
              });
            }}
          >
            Profile
          </a>
          <a
            href="#"
            style={style2}
            onMouseEnter={() => {
              setStyle2({
                color: "white",
                marginTop:"4vh",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
              });
            }}
            onMouseLeave={() => {
              setStyle2({
                color: "black",
                marginTop:"4vh",
                textDecoration: "none",
              });
            }}
          >
            Enroll
          </a>
          <a
            href="#"
            style={style3}
            onMouseEnter={() => {
              setStyle3({
                color: "white",
                marginTop:"4vh",
                backgroundColor: "rgb(141 144 147 / 36%)",
                textDecoration: "none",
              });
            }}
            onMouseLeave={() => {
              setStyle3({
                color: "black",
marginTop:"4vh",
                textDecoration: "none",
              });
            }}
          >
            TimeTable
          </a>
          <div className="logo">
            <img
              src={IITILOGO}
              alt="logo"
              style={{ width: "5rem",bottom:"2rem", position: "absolute" }}
            />
          </div>
        </div>
      </div>
    </>
  );
}
